import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    BrowserRouter
  } from "react-router-dom";
import Navbar from './components/navbar'

const index = () => {
    return (
        <>
          <Router>
              <Switch>
                  <Navbar/>
              </Switch>
          </Router> 
        </>
    )
}

export default index
